<script lang="ts">
	import { onMount } from 'svelte';
	import jsPDF from 'jspdf';
	import { Alert } from 'flowbite-svelte';
	import Pagination from '$lib/components/Pagination.svelte';
	import { Logger } from '$lib/utils/logger';

	const AlertAny = Alert as any;

	type Channel = {
		name: string;
		system: number;
		real: number;
	};

	type CashClosure = {
		id: string;
		date: string;
		note: string;
		cashier: string;
		store: string;
		channels: {
			dataphone: Channel;
			rappi: Channel;
			justo: Channel;
		};
		efectivo: {
			base: number;
			ventas: number;
			gastos: number;
			ingresos: number;
			egresos: number;
			pos: number;
			real: number;
			diferencia: number;
		};
		createdAt: string;
	};

	type Descuadre = {
		id: string;
		date: string;
		cashier: string;
		store: string;
		metodo: 'Efectivo' | 'DatÃ¡fono';
		valor: number;
		createdAt: string;
	};

	let closures = $state<CashClosure[]>([]);
	let loading = $state(true);
	let error = $state<string | null>(null);
	let pdfError = $state('');
	let pdfSuccess = $state('');

	let filterCashier = $state('');
	let filterStore = $state('');
	let filterFrom = $state('');
	let filterTo = $state('');
	let filterMetodoEfectivo = $state(true);
	let filterMetodoDatafono = $state(true);

	let cashierOptions = $state<string[]>([]);
	let storeOptions = $state<string[]>([]);

	// Pagination state
	let currentPage = $state(1);
	let itemsPerPage = $state(8);

	const loadClosures = async () => {
		loading = true;
		error = null;

		try {
			const res = await fetch(`/api/closures`);
			if (!res.ok) throw new Error('Error al cargar cierres');
			const data = await res.json();
			closures = data.closures ?? [];
			cashierOptions = data.cashiers ?? [];
			storeOptions = data.stores ?? [];
		} catch (err) {
			Logger.error(err);
			error = 'No se pudieron cargar los descuadres';
		} finally {
			loading = false;
		}
	};

	const descuadresBase = $derived(
		closures.flatMap<Descuadre>((c) => {
			const rows: Descuadre[] = [];

			// Descuadre en efectivo: solo consideramos si diferencia es negativa
			if (c.efectivo.diferencia < 0) {
				rows.push({
					id: `${c.id}-efectivo`,
					date: c.date,
					cashier: c.cashier,
					store: c.store,
					metodo: 'Efectivo',
					valor: c.efectivo.diferencia,
					createdAt: c.createdAt
				});
			}

			// Descuadre en datÃ¡fono: solo si real - sistema es negativo
			const diffDataphone = c.channels.dataphone.real - c.channels.dataphone.system;
			if (diffDataphone < 0) {
				rows.push({
					id: `${c.id}-dataphone`,
					date: c.date,
					cashier: c.cashier,
					store: c.store,
					metodo: 'DatÃ¡fono',
					valor: diffDataphone,
					createdAt: c.createdAt
				});
			}

			return rows;
		})
	);

	const inDateRange = (dateStr: string) => {
		if (!filterFrom && !filterTo) return true;
		const d = new Date(dateStr).toISOString().slice(0, 10);
		if (filterFrom && d < filterFrom) return false;
		if (filterTo && d > filterTo) return false;
		return true;
	};

	let filteredDescuadres = $derived(
		descuadresBase.filter((d) => {
			if (filterCashier && d.cashier !== filterCashier) return false;
			if (filterStore && d.store !== filterStore) return false;

			const efectivoSelected = filterMetodoEfectivo;
			const dataphoneSelected = filterMetodoDatafono;

			// Si ningÃºn mÃ©todo estÃ¡ seleccionado, no mostramos resultados
			if (!efectivoSelected && !dataphoneSelected) return false;

			// Solo efectivo
			if (efectivoSelected && !dataphoneSelected && d.metodo !== 'Efectivo') return false;

			// Solo datÃ¡fono
			if (!efectivoSelected && dataphoneSelected && d.metodo !== 'DatÃ¡fono') return false;

			// Si ambos estÃ¡n seleccionados, no filtramos por mÃ©todo

			if (!inDateRange(d.date)) return false;
			return true;
		})
	);

	// Pagination calculations
	let totalPages = $derived(Math.ceil(filteredDescuadres.length / itemsPerPage));
	let paginatedDescuadres = $derived(
		filteredDescuadres.slice((currentPage - 1) * itemsPerPage, currentPage * itemsPerPage)
	);

	const handlePageChange = (page: number) => {
		currentPage = page;
		window.scrollTo({ top: 0, behavior: 'smooth' });
	};

	// ====================================================================
	// ðŸ’¡ IMPORTANTE: BASE64 DEL LOGO (Placeholder)
	// ====================================================================
	const LOGO_BASE64 =
		'data:image/png;base64,';

	const generateSelloImage = async () => {
		try {
			const svgRes = await fetch('/sello.svg');
			let svgText = await svgRes.text();

			const logoRes = await fetch('/logo-sello.png');
			const logoBlob = await logoRes.blob();
			const logoBase64 = await new Promise((resolve) => {
				const reader = new FileReader();
				reader.onloadend = () => resolve(reader.result);
				reader.readAsDataURL(logoBlob);
			});

			svgText = svgText.replace('href="logo-sello.png"', `href="${logoBase64}"`);

			const now = new Date();
			const dateStr = now.toLocaleDateString('es-CO', {
				day: '2-digit',
				month: '2-digit',
				year: 'numeric'
			});
			const timeStr = now.toLocaleTimeString('es-CO', {
				hour: '2-digit',
				minute: '2-digit',
				hour12: false
			});
			svgText = svgText.replace('CARGANDO FECHA...', `${dateStr} - ${timeStr}`);

			const img = new Image();
			const svgBlob = new Blob([svgText], { type: 'image/svg+xml;charset=utf-8' });
			const url = URL.createObjectURL(svgBlob);

			img.src = url;
			await new Promise((resolve, reject) => {
				img.onload = resolve;
				img.onerror = reject;
			});

			const canvas = document.createElement('canvas');
			canvas.width = 300;
			canvas.height = 300;
			const ctx = canvas.getContext('2d');
			if (!ctx) {
				console.error('Could not get canvas 2D context');
				URL.revokeObjectURL(url);
				return null;
			}
			ctx.drawImage(img, 0, 0);
			URL.revokeObjectURL(url);

			return canvas.toDataURL('image/png');
		} catch (e) {
			console.error('Error generating sello:', e);
			return null;
		}
	};

	const generatePdf = async (itemOrEvent?: Descuadre | MouseEvent) => {
		try {
			const item = itemOrEvent && 'id' in itemOrEvent ? (itemOrEvent as Descuadre) : null;
			const itemsToPrint = item ? [item] : filteredDescuadres;

			if (!itemsToPrint.length) {
				console.warn('No hay descuadres para generar PDF');
				return;
			}

			const cashierLabel = item ? item.cashier : filterCashier || 'Todos';
			const fromLabel = filterFrom || 'Sin definir';
			const toLabel = filterTo || 'Sin definir';
			const totalValor = itemsToPrint.reduce((acc, d) => acc + d.valor, 0);

			const doc = new jsPDF();
			const pageWidth = doc.internal.pageSize.getWidth();
			const pageHeight = doc.internal.pageSize.getHeight();
			const margin = 15;
			let y = 20;

			// ConfiguraciÃ³n de colores modernos
			const colors = {
				primary: [30, 41, 59], // Slate 800
				secondary: [100, 116, 139], // Slate 500
				accent: [248, 250, 252], // Slate 50
				border: [226, 232, 240], // Slate 200
				danger: [220, 38, 38], // Red 600
				text: [51, 65, 85] // Slate 700
			};

			// --- 1. ENCABEZADO Y BRANDING ---
			// Logo
			if (LOGO_BASE64) {
				try {
					doc.addImage(LOGO_BASE64, 'PNG', margin, y - 5, 25, 20);
				} catch (imgErr) {
					console.error('Error agregando imagen:', imgErr);
				}
			}

			// Nombre de la marca (Simulando Poppins con Helvetica Bold)
			doc.setFont('helvetica', 'bold');
			doc.setFontSize(22);
			doc.setTextColor(colors.primary[0], colors.primary[1], colors.primary[2]);
			doc.text('THE CHEESE WHEEL CO', margin + 35, y + 5);

			// TÃ­tulo del reporte
			doc.setFont('helvetica', 'normal');
			doc.setFontSize(10);
			doc.setTextColor(colors.secondary[0], colors.secondary[1], colors.secondary[2]);
			doc.text('REPORTE DE DESCUADRES DE CAJA', margin + 35, y + 12);

			y += 35;

			// --- 2. TARJETAS DE INFORMACIÃ“N (METADATOS) ---
			// Dibujamos un fondo sutil para los metadatos
			doc.setFillColor(colors.accent[0], colors.accent[1], colors.accent[2]);
			doc.setDrawColor(colors.border[0], colors.border[1], colors.border[2]);
			doc.roundedRect(margin, y, pageWidth - margin * 2, 25, 3, 3, 'FD');

			doc.setFontSize(9);
			doc.setTextColor(colors.secondary[0], colors.secondary[1], colors.secondary[2]);
			doc.text('CAJERO', margin + 5, y + 8);
			doc.text('PERIODO', margin + 70, y + 8);
			doc.text('TOTAL REGISTROS', margin + 140, y + 8);

			doc.setFontSize(11);
			doc.setFont('helvetica', 'bold');
			doc.setTextColor(colors.primary[0], colors.primary[1], colors.primary[2]);
			doc.text(cashierLabel, margin + 5, y + 16);
			doc.text(`${fromLabel} - ${toLabel}`, margin + 70, y + 16);
			doc.text(itemsToPrint.length.toString(), margin + 140, y + 16);

			y += 35;

			// --- 3. TABLA MODERNA ---
			// DefiniciÃ³n de columnas
			const colX = {
				date: margin + 5,
				store: margin + 40,
				method: margin + 90,
				value: pageWidth - margin - 5
			};

			// Encabezado de tabla
			doc.setFillColor(colors.primary[0], colors.primary[1], colors.primary[2]);
			doc.roundedRect(margin, y, pageWidth - margin * 2, 10, 2, 2, 'F');

			doc.setTextColor(255, 255, 255);
			doc.setFontSize(9);
			doc.setFont('helvetica', 'bold');
			doc.text('FECHA', colX.date, y + 6.5);
			doc.text('SEDE', colX.store, y + 6.5);
			doc.text('MÃ‰TODO', colX.method, y + 6.5);
			doc.text('VALOR', colX.value, y + 6.5, { align: 'right' });

			y += 10;

			// Cuerpo de la tabla
			doc.setFont('helvetica', 'normal');
			doc.setFontSize(10);

			itemsToPrint.forEach((d, index) => {
				// Verificar salto de pÃ¡gina
				if (y > pageHeight - 50) {
					doc.addPage();
					y = 20;
					// Re-dibujar encabezado si es nueva pÃ¡gina (opcional, aquÃ­ simple)
				}

				// Zebra striping
				if (index % 2 === 0) {
					doc.setFillColor(252, 252, 253); // Muy sutil
					doc.rect(margin, y, pageWidth - margin * 2, 10, 'F');
				}

				doc.setTextColor(colors.text[0], colors.text[1], colors.text[2]);
				doc.text(d.date, colX.date, y + 6.5);
				doc.text(d.store, colX.store, y + 6.5);

				// Badge para el mÃ©todo (simulado con texto color)
				if (d.metodo === 'Efectivo') {
					doc.setTextColor(22, 163, 74); // Green 600
				} else {
					doc.setTextColor(37, 99, 235); // Blue 600
				}
				doc.text(d.metodo, colX.method, y + 6.5);

				// Valor
				const valStr = d.valor.toLocaleString('es-CO', {
					style: 'currency',
					currency: 'COP',
					minimumFractionDigits: 0,
					maximumFractionDigits: 0
				});

				if (d.valor < 0) {
					doc.setTextColor(colors.danger[0], colors.danger[1], colors.danger[2]);
					doc.setFont('helvetica', 'bold');
				} else {
					doc.setTextColor(colors.text[0], colors.text[1], colors.text[2]);
					doc.setFont('helvetica', 'normal');
				}
				doc.text(valStr, colX.value, y + 6.5, { align: 'right' });

				// Borde inferior sutil
				doc.setDrawColor(241, 245, 249);
				doc.line(margin, y + 10, pageWidth - margin, y + 10);

				y += 10;
			});

			// --- 4. TOTALES ---
			y += 5;
			// LÃ­nea totalizadora
			doc.setDrawColor(colors.primary[0], colors.primary[1], colors.primary[2]);
			doc.setLineWidth(0.5);
			doc.line(margin + 100, y, pageWidth - margin, y);

			y += 8;
			doc.setFont('helvetica', 'bold');
			doc.setFontSize(12);
			doc.setTextColor(colors.primary[0], colors.primary[1], colors.primary[2]);
			doc.text('TOTAL DESCUADRES: ', margin + 100, y);

			const totalStr = totalValor.toLocaleString('es-CO', {
				style: 'currency',
				currency: 'COP',
				minimumFractionDigits: 0,
				maximumFractionDigits: 0
			});
			if (totalValor < 0) doc.setTextColor(colors.danger[0], colors.danger[1], colors.danger[2]);
			doc.text(totalStr, colX.value, y, { align: 'right' });

			// --- 5. PIE DE PÃGINA (FIRMA Y SELLO) ---
			// Asegurar espacio suficiente
			const footerHeight = 50;
			if (y + footerHeight > pageHeight - margin) {
				doc.addPage();
				y = 20;
			} else {
				y = Math.max(y + 40, pageHeight - footerHeight - margin);
			}

			// Estilo de firma mÃ¡s moderno
			doc.setDrawColor(colors.secondary[0], colors.secondary[1], colors.secondary[2]);
			doc.setLineWidth(0.2);
			doc.line(margin, y + 30, margin + 70, y + 30); // LÃ­nea firma

			doc.setFontSize(8);
			doc.setTextColor(colors.secondary[0], colors.secondary[1], colors.secondary[2]);
			doc.setFont('helvetica', 'normal');
			doc.text('FIRMA DEL CAJERO RESPONSABLE', margin, y + 35);

			// Recuadro para sello con bordes redondeados
			const boxSize = 50;
			const boxX = pageWidth - margin - boxSize;
			const boxY = y;

			try {
				const selloBase64 = await generateSelloImage();
				if (selloBase64) {
					const centerX = boxX + boxSize / 2;
					const centerY = boxY + boxSize / 2;
					const angle = -12; // Ajusta este valor (-15 a 15 funciona bien)

					doc.addImage(
						selloBase64,
						'PNG',
						boxX,
						boxY,
						boxSize,
						boxSize,
						undefined,
						undefined,
						angle // Ãngulo de rotaciÃ³n
					);
				} else {
					throw new Error('Sello generation failed');
				}
			} catch (e) {
				// Fallback
				doc.setDrawColor(203, 213, 225); // Slate 300
				doc.setLineWidth(0.5);
				doc.roundedRect(boxX, boxY, boxSize, boxSize, 2, 2, 'S');

				doc.setTextColor(203, 213, 225);
				doc.text('SELLO', boxX + boxSize / 2, boxY + boxSize / 2, {
					align: 'center',
					baseline: 'middle'
				});
			}

			// Guardar PDF
			const safeCashier = cashierLabel.replace(/[^a-zA-Z0-9_-]+/g, '_');
			const fileName = `reporte_descuadres_${safeCashier}.pdf`;
			doc.save(fileName);

			pdfSuccess = 'PDF generado exitosamente';
			pdfError = '';
			setTimeout(() => (pdfSuccess = ''), 5000);
		} catch (err) {
			console.error('Error generando PDF:', err);
			pdfError = 'Hubo un error al generar el PDF. Revisa la consola para mÃ¡s detalles.';
			pdfSuccess = '';
		}
	};

	onMount(loadClosures);
</script>

<h1 class="text-xl font-semibold mb-4">Descuadres</h1>

<!-- PDF Alerts -->
{#if pdfSuccess}
	<AlertAny color="green" dismissable class="mb-4">
		<svelte:fragment slot="icon">
			<svg class="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
				<path
					fill-rule="evenodd"
					d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z"
					clip-rule="evenodd"
				/>
			</svg>
		</svelte:fragment>
		<span class="font-medium">Â¡Ã‰xito!</span>
		{pdfSuccess}
	</AlertAny>
{/if}

{#if pdfError}
	<AlertAny color="red" dismissable class="mb-4">
		<svelte:fragment slot="icon">
			<svg class="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
				<path
					fill-rule="evenodd"
					d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7-4a1 1 0 11-2 0 1 1 0 012 0zM9 9a1 1 0 000 2v3a1 1 0 001 1h1a1 1 0 100-2v-3a1 1 0 00-1-1H9z"
					clip-rule="evenodd"
				/>
			</svg>
		</svelte:fragment>
		<span class="font-medium">Error:</span>
		{pdfError}
	</AlertAny>
{/if}

<div class="space-y-6">
	<div class="flex flex-col md:flex-row md:items-center justify-between gap-4">
		<h1 class="text-2xl md:text-3xl font-bold text-gray-900">AnÃ¡lisis de Descuadres</h1>
		<div class="flex gap-2">
			<!-- Export buttons could go here -->
		</div>
	</div>

	<!-- Filters -->
	<section class="bg-white rounded-2xl shadow-soft border border-gray-100 p-5 md:p-6">
		<h3 class="text-sm font-bold text-gray-500 uppercase tracking-wider mb-4">Filtros</h3>
		<div class="grid grid-cols-1 md:grid-cols-4 gap-5">
			<!-- Date Range -->
			<div class="space-y-2">
				<label for="filter-from" class="text-xs font-semibold text-gray-500 uppercase"
					>Fecha Inicio</label
				>
				<input
					id="filter-from"
					type="date"
					bind:value={filterFrom}
					class="w-full h-11 rounded-xl border border-gray-200 bg-white px-4 text-sm focus:outline-none focus:ring-2 focus:ring-dark-orange-500/20 focus:border-dark-orange-500 transition-all font-medium text-gray-700"
				/>
			</div>

			<div class="space-y-2">
				<label for="filter-to" class="text-xs font-semibold text-gray-500 uppercase"
					>Fecha Fin</label
				>
				<input
					id="filter-to"
					type="date"
					bind:value={filterTo}
					class="w-full h-11 rounded-xl border border-gray-200 bg-white px-4 text-sm focus:outline-none focus:ring-2 focus:ring-dark-orange-500/20 focus:border-dark-orange-500 transition-all font-medium text-gray-700"
				/>
			</div>

			<!-- Store Filter -->
			<div class="space-y-2">
				<label for="filter-store" class="block text-xs font-medium text-gray-500 mb-1">Tienda</label
				>
				<div class="relative">
					<select
						id="filter-store"
						bind:value={filterStore}
						class="w-full h-11 rounded-xl border border-gray-200 bg-white px-4 text-sm focus:outline-none focus:ring-2 focus:ring-dark-orange-500/20 focus:border-dark-orange-500 transition-all appearance-none cursor-pointer font-medium text-gray-700"
					>
						<option value="">Todas las tiendas</option>
						{#each storeOptions as s}
							<option value={s}>{s}</option>
						{/each}
					</select>
					<div
						class="absolute inset-y-0 right-0 flex items-center px-4 pointer-events-none text-gray-500"
					>
						<svg class="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24"
							><path
								stroke-linecap="round"
								stroke-linejoin="round"
								stroke-width="2"
								d="M19 9l-7 7-7-7"
							></path></svg
						>
					</div>
				</div>
			</div>

			<!-- Cashier Filter -->
			<div class="space-y-2">
				<label for="filter-cashier" class="block text-xs font-medium text-gray-500 mb-1"
					>Cajero</label
				>
				<div class="relative">
					<select
						id="filter-cashier"
						bind:value={filterCashier}
						class="w-full h-11 rounded-xl border border-gray-200 bg-white px-4 text-sm focus:outline-none focus:ring-2 focus:ring-dark-orange-500/20 focus:border-dark-orange-500 transition-all appearance-none cursor-pointer font-medium text-gray-700"
					>
						<option value="">Todos los cajeros</option>
						{#each cashierOptions as c}
							<option value={c}>{c}</option>
						{/each}
					</select>
					<div
						class="absolute inset-y-0 right-0 flex items-center px-4 pointer-events-none text-gray-500"
					>
						<svg class="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24"
							><path
								stroke-linecap="round"
								stroke-linejoin="round"
								stroke-width="2"
								d="M19 9l-7 7-7-7"
							></path></svg
						>
					</div>
				</div>
			</div>
		</div>

		<!-- Payment Method Toggles -->
		<div class="mt-6 flex flex-wrap gap-4 pt-4 border-t border-gray-100">
			<label class="inline-flex items-center gap-2 cursor-pointer group">
				<div class="relative">
					<input type="checkbox" bind:checked={filterMetodoEfectivo} class="peer sr-only" />
					<div
						class="w-11 h-6 bg-gray-200 peer-focus:outline-none peer-focus:ring-4 peer-focus:ring-dark-orange-500/20 rounded-full peer peer-checked:after:translate-x-full rtl:peer-checked:after:-translate-x-full peer-checked:after:border-white after:content-[''] after:absolute after:top-[2px] after:start-[2px] after:bg-white after:border-gray-300 after:border after:rounded-full after:h-5 after:w-5 after:transition-all peer-checked:bg-dark-orange-500"
					></div>
				</div>
				<span
					class="text-sm font-medium text-gray-700 group-hover:text-dark-orange-600 transition-colors"
					>Efectivo</span
				>
			</label>

			<label class="inline-flex items-center gap-2 cursor-pointer group">
				<div class="relative">
					<input type="checkbox" bind:checked={filterMetodoDatafono} class="peer sr-only" />
					<div
